    },
    {
        name: "кроссовки 1",
        model: "адидас"
    },
    {
        name: "кроссовки 2",
        model: "адидас"
    },

];
function App()
{
  return (
    <div className="App">
        <header className="Header">

        </header>

      <div className="shop-items">
          <p className="shop-l">кроссовки</p>
          <p className="shop-o"> puma</p>
      </div>
        <div className="shop-items">
            <p className="shop-l">кроссовки</p>
            <p className="shop-o"> puma</p>
        </div>
        <div className="shop-items">
            <p className="shop-l">кроссовки</p>
            <p className="shop-o"> puma</p>
        </div>

        {
            tamble.map((item) => (
            <div className="shop-items">
            <p className="shop-l">{item.model}</p>
            <p className="shop-o"> puma</p>
            </div>

            ))

        }
    </div>
  );
}

export default App;
